import APIHandler from './APIHandler.js';

class APIStorage extends APIHandler{
    
    
    async deleteSimulation(){
        try {
            const data = await this.getRequest(
              "http://54.146.196.79:8080/dp1/api/storage/deleteSimulated"
            );
            return data;
          } catch (error) {
            console.error(error);
        }      
    }

    async updateCheckOut(){
      try {
          const data = await this.getRequest(
            "http://54.146.196.79:8080/dp1/api/storage/update/checkout?idPack=4&idWarehouse=1"
          );
          return data;
        } catch (error) {
          console.error(error);
      }      
    }
    async updateCheckIn(){
      try {
          const data = await this.getRequest(
            "http://54.146.196.79:8080/dp1/api/storage/update/checkin?idPack=4&idWarehouse=4"
          );
          return data;
        } catch (error) {
          console.error(error);
      }      
  }





}
export default APIStorage;
